import React from "react";

const Card = ({name, capital, region}) => {
    return(
        <div className="bg-light-green pa3 dib br4 ma2 grow bw2 shadow-5 tc ">
            <img src={`https://restcountries.eu/data/col.svg`} alt="country"/>
            <div>
                <h2>{name}</h2>
                <p>{capital}</p>
                <p>{region}</p>
            </div>
        </div>
    )
}

export default Card;
